import React from "react";
import { Box, Typography, Link, Divider } from "@mui/material";

const Header = () => {
  return (
    <>
      <Grid container>
        <Typography variant="h3" my={2}>
          Classificador de Fake News
        </Typography>
        <Divider />
        <Typography variant="h6">
          <strong>Como Funciona?</strong>
        </Typography>
        <Typography variant="article">
          Copie o texto completo da notícia, cole no campo abaixo e clique em
          "Enviar".
        </Typography>
        <Typography variant="article">
          Nosso sistema irá processar o texto e classificar a possibilidade da
          notícia ser falsa.
        </Typography>
      </Grid>
    </>
  );
};

export default Header;
